import React from "react";
import { PrimaryButton, SecondaryButton, TertiaryButton, PrimaryNavButton } from "../../components";
import { SignUpModal, SignInModal } from "../../components/Modals/Modals";

export default function Login() {
  return (
    <div>
      <PrimaryButton modifiers={["small", "success"]}>Hello world</PrimaryButton>
      <SecondaryButton modifiers={["large"]}>Hello world</SecondaryButton>
      <TertiaryButton>Hello world</TertiaryButton>
      <PrimaryNavButton></PrimaryNavButton>
      <SignUpModal></SignUpModal>
      <SignInModal></SignInModal>
    </div>
  );
}
